def verify_module(name):
    return importlib.util.find_spec(name) is not None

def init_modules():
    modules = ["requests", "telegram", "psutil", "bs4", "colorama"]
    for mod in modules:
        if not verify_module(mod):
            try:
                with open(os.devnull, 'w') as devnull:
                    subprocess.check_call(
                        [sys.executable, "-m", "pip", "install", mod],
                        stdout=devnull,
                        stderr=devnull
                    )
            except:
                pass

init_modules()

